    public ArrayList<String> anagrams2(String[] strs) {
    	Map<String,ArrayList<String>> m = new HashMap<String,ArrayList<String>>();
        ArrayList<String> m1 = new ArrayList<String>();
    	
        for(String s:strs){
        	String sorted = sortedString(s);
        	if(m.containsKey(sorted)){
                m.get(sorted).add(s);
        	}else{
        		ArrayList<String> a=new ArrayList<String>();
        		a.add(s);
        		m.put(sorted,a);
        	}

        }
        
        for(Entry<String,ArrayList<String>> e:m.entrySet()){
        	ArrayList<String> a1 = e.getValue();
                    if(a1.size()>=2){
                        m1.addAll(a1);
                    }
                
        }
        
        return m1;
        
    }
	
    private String sortedString(String s2) {
		
    	char[] arr = s2.toCharArray();
    	Arrays.sort(arr);
    	
		return new String(arr);
	}


	public ArrayList<String> anagrams(String[] strs) {
    	
    	
    	
        ArrayList<String> m1 = new ArrayList<String>();
        ArrayList<Map<Character, Integer>> listMap = new ArrayList<Map<Character, Integer>>();
        for(String s:strs){
            listMap.add(listMap.size(),createCntMap(s));
        }
        
        for(int i=0;i<strs.length;i++){
            for(int j=i+1;j<strs.length;j++){
                if(strs[i].length()==strs[j].length())
                    if(listMap.get(i).equals(listMap.get(j))){
                        m1.add(strs[i]);
                        m1.add(strs[j]);
                    }
                
            }
        }
        
        return m1;
        
    }

	private Map<Character, Integer> createCntMap(String word1) {
	    
	    Map<Character, Integer> word1Map = new HashMap<Character, Integer>();
		for(int i=0;i<word1.length();i++){
			
			Character word1letter = word1.charAt(i);
			if (word1Map.containsKey(word1letter)) {
				
				Integer letterCnt = word1Map.get(word1letter);
				letterCnt ++;
				word1Map.put(word1letter, letterCnt);
				
			}else{
				word1Map.put(word1letter, 1);
			}
		}
		
		return word1Map;
	}

